// src/components/NavigationBar.js
import React from 'react';

const NavigationBar = ({ handleShowLogin, handleShowSignup }) => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <a className="navbar-brand" href="#">Your Brand</a>
      <button className="btn btn-primary" onClick={handleShowLogin}>Login</button>
      <button className="btn btn-secondary" onClick={handleShowSignup}>Sign Up</button>
    </nav>
  );
};

export default NavigationBar;
